import React from "react";
import "./Board.css";

const Board = ({ board, makeMove }) => {
  return (
    <div className="board">
      {board.map((cell, index) => (
        <div
          key={index}
          className={`cell ${cell ? "disabled" : ""}`}
          onClick={() => makeMove(index)}
        >
          {cell}
        </div>
      ))}
    </div>
  );
};

export default Board;
